  false,\n\t\"url\": null,\n\t\"notes\": \"This data series contains 137 1998-2001
  10-meter pachromatic digital orthoimage tiles. The data cover the State of Idaho.
  The SPOT USA Select product is a statewide panchromatic tonal balanced, 30-minute
  x 30-minute SPOTView product designed to be load-n-go into GIS and image processing
  systems. The source imagery is SPOT PAN 10-meter data. The most current imagery
  was preferred. Fall/Winter/Spring (leaf-off) scenes were preferred, but summer (leaf-on)
  imagery was used if scene gaps were present. Access is restricted to Idaho State
  Government; Idaho Regional, County and Local Governments; Idaho K-12 public schools,
  State Colleges and State Universities. See this <a href=\"http://cloud.insideidaho.org/HelpDocs/spotLicenseAgreement.pdf\"
  target=\"_blank\">License Agreement</a> for more information.\",\n\t\"license_title\":
